/**
 * @typedef {string} DialogChangeType
 */

/**
 * A enum of possible dialog change types
 * @enum {DialogChangeType}
 * @category Conversation
 */
const DialogChangeType = {
    /** Creates a new dialog, rarely used by clients */
    CREATE: 'CREATE',
    /** Change the given dialog */
    UPDATE: 'UPDATE'
};

module.exports = DialogChangeType;
